import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import heroBg from "../images/hero-bg.jpg";

const Partnership = () => {
  const navigate = useNavigate();
  const [searchParams, setSearchParams] = useState({
    location: "",
    orgType: "",
    goal: "",
  });

  const handleSearch = (e) => {
    e.preventDefault();
    // 处理搜索逻辑
    console.log("Search params:", searchParams);
  };

  return (
    <div className="min-h-screen relative">
      {/* 半透明背景图 */}
      <div className="absolute inset-0">
        <img
          src={heroBg}
          alt="Background"
          className="w-full h-full object-cover"
        />
        <div className="absolute inset-0 bg-cyan-600/30 backdrop-blur-sm"></div>
      </div>

      {/* 返回按钮 */}
      <button
        onClick={() => navigate(-1)}
        className="absolute top-8 left-8 text-white hover:text-cyan-100 z-10"
      >
        <svg
          xmlns="http://www.w3.org/2000/svg"
          className="h-8 w-8"
          fill="none"
          viewBox="0 0 24 24"
          stroke="currentColor"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth={2}
            d="M10 19l-7-7m0 0l7-7m-7 7h18"
          />
        </svg>
      </button>

      {/* 主要内容 */}
      <div className="relative z-10 pt-32 px-4 sm:px-6 lg:px-8">
        <div className="max-w-5xl mx-auto text-center">
          <h1 className="text-5xl font-bold text-white mb-8">
            Let's Find Your Perfect Partner
          </h1>

          {/* 搜索表单 */}
          <div className="bg-white rounded-xl shadow-xl p-6 mt-8">
            <form onSubmit={handleSearch} className="space-y-6">
              <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
                {/* Location */}
                <div className="relative">
                  <label className="absolute -top-3 left-4 bg-white px-2 text-sm font-medium text-cyan-600">
                    Location
                  </label>
                  <input
                    type="text"
                    className="w-full p-4 border border-gray-200 rounded-lg focus:ring-2 focus:ring-cyan-500 focus:border-transparent"
                    placeholder="Enter location"
                    value={searchParams.location}
                    onChange={(e) =>
                      setSearchParams({
                        ...searchParams,
                        location: e.target.value,
                      })
                    }
                  />
                </div>

                {/* Organization Type */}
                <div className="relative">
                  <label className="absolute -top-3 left-4 bg-white px-2 text-sm font-medium text-cyan-600">
                    Organization Type
                  </label>
                  <select
                    className="w-full p-4 border border-gray-200 rounded-lg focus:ring-2 focus:ring-cyan-500 focus:border-transparent"
                    value={searchParams.orgType}
                    onChange={(e) =>
                      setSearchParams({
                        ...searchParams,
                        orgType: e.target.value,
                      })
                    }
                  >
                    <option value="">Select type</option>
                    <option value="nonprofit">Nonprofit</option>
                    <option value="forprofit">For-Profit</option>
                    <option value="social">Social Enterprise</option>
                    <option value="government">Government</option>
                  </select>
                </div>

                {/* Partnership Goal */}
                <div className="relative">
                  <label className="absolute -top-3 left-4 bg-white px-2 text-sm font-medium text-cyan-600">
                    What Kind of Organization Are You Looking For?
                  </label>
                  <textarea
                    className="w-full p-4 border border-gray-200 rounded-lg focus:ring-2 focus:ring-cyan-500 focus:border-transparent"
                    placeholder="Describe your ideal partner..."
                    rows="1"
                    value={searchParams.goal}
                    onChange={(e) =>
                      setSearchParams({ ...searchParams, goal: e.target.value })
                    }
                  />
                </div>
              </div>

              {/* Search Button */}
              <button
                type="submit"
                className="w-full md:w-auto px-8 py-4 bg-cyan-600 text-white rounded-lg hover:bg-cyan-700 transition-colors duration-200"
              >
                Search Partners
              </button>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Partnership;
